import React from 'react';


import {
    Container
   } from 'reactstrap';

const SlideSecond  = () => {

  return (
    <div className="SlideSecond">

        <Container>
            <h1>Second Slide</h1>
        </Container>
    </div>
  );
}

export default SlideSecond ;
